import React from 'react';
import { Route, Switch } from 'react-router-dom';
import Home from './pages/home';
import BuyModule from './pages/buy';
import BorrowModule from './pages/borrow';

class Routes extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      dir: process.env.REACT_APP_DIR,
    };
  }

  render() {
    return (
      <Switch>
        <Route
          path={this.state.dir + '/'}
          exact
          key={0}
          component={Home}
        />
        <Route path={this.state.dir + '/buy'} component={BuyModule} />
        <Route path={this.state.dir + '/borrow'} component={BorrowModule} />
      </Switch>
    );
  }
}

export default Routes;
